import React, { Component } from "react";
import { Table, Input, Select, Radio, Pagination } from "antd";
import transactionDetailsService from "./TransactionDetailsService";

export class TransactionDetails extends Component {
    constructor(props) {
      super(props);
      this.state = {
        loading: false,
        data: [],
        pagination: {
          page: 0,
          size: 10
        },
      };
    }

    componentDidMount() {
        this.loadData();
        //this.props.loadTransactionDetails();
        //axios.get('/transaction-details/load-parent-details')
        //.then(response=>console.log(response));
    }

    loadData(){
        this.setState({ loading: true }, () => {
            transactionDetailsService
              .loadTransactionDetails()
              .then(data => {
                this.setState({ data });
                console.log(data);
              })
              .catch(err => {
                console.log("DEBUG err ", err);
              })
              .then(() => {
                this.setState({ loading: false });
              });
          });
    }

    render() {
        const { loading, data } = this.state;
        const columns = [];
        return (
            <React.Fragment>
                <p>
                Hello
                </p>
                <Table className="test-BE-user-list" loading={loading} columns={columns} data={data.parent} onChange={this.loadingData} scroll={{ x: 880 }} />

            </React.Fragment>
        )
    }

}

/*export default connect(
    mapStateToProps,
    actionCreators
  ) (TransactionDetails);*/
export default TransactionDetails;
